import React from 'react';

const logos = [
  {
    src: 'https://upload.wikimedia.org/wikipedia/commons/a/a7/React-icon.svg',
    alt: 'React',
  },
  {
    src: 'https://tailwindcss.com/_next/static/media/tailwindcss-mark.6ea76c3b.svg',
    alt: 'Tailwind CSS',
  },
  {
    src: 'https://seeklogo.com/images/O/openai-logo-8B9BFEDC26-seeklogo.com.png',
    alt: 'OpenAI',
  },
];

const TechStack = () => (
  <section className="w-full py-10 bg-white flex flex-col items-center">
    <h2 className="text-xl font-semibold text-gray-700 mb-6">Powered by</h2>
    <div className="flex flex-row gap-8 items-center justify-center">
      {logos.map((logo, idx) => (
        <img
          key={idx}
          src={logo.src}
          alt={logo.alt}
          className="h-12 w-auto grayscale hover:grayscale-0 transition duration-200"
        />
      ))}
    </div>
  </section>
);

export default TechStack;
